script: |
  super -f tsv -I q4433.sql | sort > q4433.out

vector: true

inputs:
  - name: q4433.sql
    data: |
      SELECT ALL + - 16 FROM tab2 cor0 GROUP BY col0, col0, col2 HAVING NOT col2 * + ( - 50 ) IN ( - col2 * 71 * + 6, col0 );
  - name: tab2

outputs:
  - name: q4433.out
    data: |
      -16
      -16
      -16
